import React, { Component } from 'react';

class CreateLocationComponent extends Component {

    constructor(props){
        super(props)

        this.state = {
            locations: []
        }
    }

    render() {
        return (
            <div>
                <h1>Location Form</h1>
            </div>
        );
    }
}

export default CreateLocationComponent;
